import {Journey} from "./Journey";
import {Cognate} from "./Cognate";

export class Collections extends Component
{
	constructor(props)
	{
		super(props);
		this.state = {
			mapMode: this.props.mapMode,
			items: []
		};
	}

	render()
	{
		let itemElements = [];

		this.state.items.forEach((header) => {
			if(this.state.mapMode === "cognate")
			{
				itemElements.push(
					<Journey />
				)
			}
			else if(this.state.mapMode === "journey")
			{
				itemElements.push(
					<Cognate />
				)
			}

		})

